        // Maintain the open state of the menu when the data is changed.
        var isOpen = select.isOpen();
        // Force a re-build of the selection model.
        select.setMenu(null);
        select.setMenu(menu);
        // Update the selected value after changing the selection model.
        updateFromViewValue();
